(function () {
  'use strict';

  $(document).ready(function () {
    // CSRF token
    $.ajaxSetup({
      headers: {
        'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
      }
    }); // Top line

    $('#top-line').css({
      width: '100%',
      height: '2.5px',
      backgroundImage: 'linear-gradient(to right, black, red, green)'
    }); // Navbar toggle

    $('#toggle').click(function (event) {
      $('#toggle').toggleClass('toggle--change');
      $('#navbar').slideToggle();
    });
  });

}());

